import React from 'react';
import FancyText from '@carefully-coded/react-text-gradient';

const Home = () => {

  return (
    <div className="col-item mt-4 text-start">
      <FancyText
        gradient={{ from: '#F8D500', to: '#6DEDD0', type: 'linear' }}
        animateTo={{ from: '#FE2E2E', to: '#33B5E2' }}
        animateDuration={2000}
      >
        Hello !
      </FancyText>
    </div>
  );
};

export default Home;
